import { StyleSheet, Text, View } from 'react-native'
import React from 'react'

const SignUpScreen = () => {
  return (
    <View>
      <Text>Create Account</Text>
    </View>
  )
}

export default SignUpScreen

const styles = StyleSheet.create({})
